import { Button, Input, Grid } from '@mantine/core';
import {
  RegisterSection
} from "./styles";

export function Register() {
  return (
    <RegisterSection>
      <Grid>
        <Grid.Col>
          <Input.Wrapper
            id="input-nome"
            withAsterisk
            label="Nome Completo"
            
          >
            <Input id="input-nome" placeholder="Nome Completo" className="focus:shadow-lg shadow-red-500 md:shadow-xl md:shadow-red-500"/>
          </Input.Wrapper>
        </Grid.Col>
        <Button className="bg-primary-accent hover:bg-secondary-accent">
          Cadastrar
        </Button>
      </Grid>
    </RegisterSection>

  );
}
